import react from "react"
import ReorderIcon from '@mui/icons-material/Reorder';
import { IconButton } from "@mui/material"

const Header = ()=> {
    return (
        <div className="header">
            <div className="header_left">
                <IconButton>
                    <ReorderIcon></ReorderIcon>
                </IconButton>
            </div>
        </div>
    )
}

export default Header
